function Cart(props) {
    const { cartItems } = props;

    return (
      <div>
        <h2>Cart Items</h2>
        {cartItems.map((item, index) => (
          <div className="cart-item">
            <p>{item.name}</p>
            <p>{item.price}</p>
            <p>{item.amount}</p>
          </div>
        ))}
      </div>
    );
  }

  export default Cart;
